unsigned char l_capturing(unsigned int len)
{
	int bottom = 0;
	int top    = 170;
	unsigned char idx = 85;

	while (1) {
		if (idx == 0) {
			return(idx);
		}
		if ((len <= topval[idx]) && (len > topval[idx-1])) {
// printf("len=%u	idx=%u\n", len, idx);
			return(idx);
		}
		if (len < topval[idx]) {
			top = idx - 1;
		} else {
			bottom = idx + 1;
		}
		idx = (bottom + top) / 2;
	}
}

int mod_diff(unsigned int x, unsigned int y, unsigned int R)
{
    int dl = 0;
    int dr = 0;
    if ( y > x ){
        dl = (int)(y - x);
        dr = (int)(x + R - y);
    }else{
        dl = (int)(x - y);
        dr = (int)(y + R - x);
    }
    return (dl > dr ? dr : dl);
}

